import streamlit as st 
import pickle
import os
st.image(r'https://innomatics.in/wp-content/uploads/2023/01/Innomatics-Logo1.png')
st.title("Welcome to Emotion Predictor")

import os

# Get the absolute path to the current script
script_path = os.path.abspath(__file__)

# Set the working directory to the script's directory
os.chdir(os.path.dirname(script_path))

# Specify the path to the model folder relative to the script's directory
model_folder = "model"

# Construct the full path to the model file
model_file_path = os.path.join(model_folder, 'emotions_pred.pkl')

# Open the file
with open(model_file_path, 'rb') as model_file:

    loaded_model = pickle.load(model_file)

msg = st.text_input("Enter your emotion")

predictions = loaded_model.predict([msg]) 

submit_button = st.button(label="Predict")
if submit_button == True:
    if predictions[0] == 'sad':
        st.image(r'data:image/jpeg;base64,')
    elif predictions[0] == 'joy':
        st.image(r'data:image/jpeg;base64,')
    elif predictions[0] == 'love':
        st.image(r'data:image/jpeg;base64,')
    elif predictions[0] == 'anger':
        st.image(r'data:image/jpeg;base64,')
    elif predictions[0] == 'fear':
        st.image(r'data:image/jpeg;base64,')
    else:
        st.image(r'data:image/jpeg;base64,')
        
    st.header(f"Prediction : {predictions[0]}")
    


    
